window.bookSummaryJSON = "<p>American scientist Matt Miller has been torn from his own century and dumped into colonial Virginia with only his backpack and his wits. He has come to terms with where he is and when and has surrounded himself with new friends but has also made an enemy who has sworn his destruction.&nbsp;</p> <p>Matt now leaves Virginia to make his fortune in Philadelphia, with the hope of returning and claiming the hand of the woman he loves. It seems predestined that he has been dropped into this new century to succeed on a grand scale. He soon finds that a sworn enemy in colonial America is no small thing.</p>"; 
